import Navbar from './components/Navbar'
import Home from './pages/Home'
import Cart from '.pages/Cart'
import {Routes, Route } from 'react-router'

const App = () => {
  return (
    <div>
      <Navbar/>
      <Routes>
        <Route path="/home" element={<Home />}/>
        <Route path="/cart" element={<Cart />}/>
      </Routes>
    </div>
  )
};

export default App;
